termsFooter_howItWorks_text:
Dra og slipp filer i det angitte området eller velg dem på tradisjonell måte; filene blir kryptert og sendt til serveren. Du vil motta to lenker til filen: 
 en nedlastingslenke som du kan dele med andre;
 og en slettelenke, som du kan bruke til å slette filen når som helst.
